BEGIN TRANSACTION;
DROP TABLE IF EXISTS "radan";
CREATE TABLE IF NOT EXISTS "radan" (
	"patient_id"	INTEGER,
	"blood_pressure"	FLOAT,
	"exercise"	FLOAT,
	"weight"	FLOAT,
	"glucose"	FLOAT,
	"bmi"	FLOAT,
	"planet_id"	INTEGER,
	PRIMARY KEY("patient_id")
);
DROP TABLE IF EXISTS "deidentify";
CREATE TABLE IF NOT EXISTS "deidentify" (
	"patient_id"	INTEGER,
	"age"	FLOAT,
	PRIMARY KEY("patient_id")
);
DROP TABLE IF EXISTS "boran";
CREATE TABLE IF NOT EXISTS "boran" (
	"patient_id"	INTEGER,
	"blood_pressure"	FLOAT,
	"exercise"	FLOAT,
	"weight"	FLOAT,
	"glucose"	FLOAT,
	"bmi"	FLOAT,
	"planet_id"	INTEGER,
	PRIMARY KEY("patient_id")
);
COMMIT;
